  function updateGauge(account_score) {
    var opts = {
      angle: 0,
      // A extensão do arco do medidor
      lineWidth: 0.3,
      // A espessura da linha
      radiusScale: 0.8,
      // Raio relativo
      pointer: {
        length: 0.47,
        // Em relação ao raio de medição
        strokeWidth: 0.035,
        // A espessura
        color: "#000000" // Cor de preenchimento

      },
      limitMax: true,
      // Se for falso, o valor máximo aumenta automaticamente se o valor> maxValue
      limitMin: true,
      // If true, the min value of the gauge will be fixed
      colorStart: "#6FADCF",
      // Colors
      colorStop: "#FE330A",
      // just experiment with them
      strokeColor: "#8FC0DA",
      // to see which ones work best for you
      generateGradient: true,
      highDpiSupport: false,
      // Suporte de alta resolução
      // renderTicks é opcional
      renderTicks: {
        divisions: 0,
        divWidth: 0.1,
        divLength: 0,
        divColor: "#333333",
        subDivisions: 0,
        subLength: 0,
        subWidth: 10,
        subColor: "#666666"
      },
      staticZones: [{
        strokeStyle: "#FF3006",
        min: 0,
        max: 2,
        height: 1.3
      }, {
        strokeStyle: "#FFAF00",
        min: 2,
        max: 4,
        height: 1.3
      }, {
        strokeStyle: "#F2CC11",
        min: 4,
        max: 6,
        height: 1.3
      }, {
        strokeStyle: "#1BCE68",
        min: 6,
        max: 8,
        height: 1.3
      }, {
        strokeStyle: "#04A74A",
        min: 8,
        max: 10,
        height: 1.3
      }]
    };
    var target = document.getElementById("account-health-chart-gauge"); // your canvas element

    var gauge = new Gauge(target).setOptions(opts); // create sexy gauge!

    gauge.maxValue = 10; // set max gauge value

    gauge.setMinValue(0); // Prefer setter over gauge.minValue = 0

    gauge.animationSpeed = 64; // set animation speed (32 is default value)

    gauge.set(account_score); // set actual value

    removeSkeletonLoadingFromAccountHealth();
  }

